import React, { useState } from 'react';
import axios from 'axios';

const App = () => {

const [userData, setUserData] = useState(null);
const URL='http://172.20.67.54:8080/reels/applicant?hashtag=#HYPE BOY'
  const onClick = () => {
    axios.get(URL, {
        validateStatus: function (status) {
          // 상태 코드가 500 이상일 경우 거부. 나머지(500보다 작은)는 허용.
          return status < 500;
        }}).then(response => {
      setUserData(response.data);
      console.log(userData);
    })
    .catch((Error)=>{
        console.log(Error);
    });
  };


  return (
    <div>
      <div>
        <button onClick={onClick}>불러오기</button>
      </div>
      {userData && <textarea rows={7} value={JSON.stringify(userData, null, 2)} readOnly={true} />}
    </div>
  );
};

export default App;
